import '../../../../../../../styles/action-sidebar.css';

export default function CouponsCustomerActionbar(props) {

    const handlePurchaseCoupons = () => {
        console.log(props)
        for (let id of Object.values(props.values.checked)) {
            //TODO fetch goes here
            console.log(id + '')
            //XXX ref in loop
            //XXX #1
            const currentRef = props.couponsRef.current[id].current
            console.log(
                currentRef.children[2].style.backgroundImage.slice(5, -2) + ' ' +
                currentRef.children[3].children[0].innerHTML + ' ' +
                currentRef.children[4].children[0].innerHTML + ' ' +
                currentRef.children[5].children[0].innerHTML + ' ' +
                currentRef.children[6].children[0].innerHTML + ' ' +
                currentRef.children[7].children[0].innerHTML + ' ' +
                currentRef.children[8].children[0].innerHTML + ' ' +
                currentRef.children[9].children[0].innerHTML
            )
            //XXX #2
            console.log(
                props.couponsRef.current[id].current.children[2].children[0].style.backgroundImage.slice(5, -2) + ' ' +
                props.couponsRef.current[id].current.children[3].children[0].innerHTML + ' ' +
                props.couponsRef.current[id].current.children[4].children[0].innerHTML + ' ' +
                props.couponsRef.current[id].current.children[5].children[0].innerHTML + ' ' +
                props.couponsRef.current[id].current.children[6].children[0].innerHTML + ' ' +
                props.couponsRef.current[id].current.children[7].children[0].innerHTML + ' ' +
                props.couponsRef.current[id].current.children[8].children[0].innerHTML + ' ' +
                props.couponsRef.current[id].current.children[9].children[0].innerHTML
            )
        }
    }

    return (
        <div className='CouponsCustomerActionbar'>
            <div className='action-sidebar'>
                <button className='action-sidebar-button' title='Purchase Coupons' onClick={handlePurchaseCoupons}>Purchase Coupons</button>
            </div>
        </div>
    )
}
